import React from 'react'
import ReactPlayer from 'react-player'
import Menu from '../Componant/Menu';
import {
    Link
} from "react-router-dom";


function Stream() {
    return (
        <div>
            <Menu />
                Video stream gotaga :
                <ReactPlayer url='https://www.twitch.tv/gotaga' />
        </div>
    );
}

export default Stream;
